package main

import "fmt"

func numSimilarGroups(strs []string) int {
	seen := make([]bool, len(strs))

	var group func(int) int
	group = func(i int) int {
		if seen[i] {
			return 0
		}
		seen[i] = true
	collect:
		for j, s2 := range strs[:i] {
			if seen[j] {
				continue
			}
			var miss int
			var p1, p2 rune
			for k, c1 := range strs[i] {
				c2 := rune(s2[k])
				switch {
				case c1 == c2:
				case miss == 0:
					miss++
					p1, p2 = c1, c2
				case miss == 1 && c1 == p2 && c2 == p1:
					miss++
				default:
					continue collect
				}
			}
			if miss == 0 || miss == 2 {
				group(j)
			}
		}
		return 1
	}
	gs := 0
	for i := range strs {
		gs += group(i)
	}

	return gs
}

